import React from "react";
import "./footer.css";

export default function Footer() {
  return (<div>
      <footer className="mt-auto py-3 fixed-bottom">
          <div className="container">
              <span className="text-muted">Footer</span>
          </div>
      </footer>
  </div>);
}
